Fluminense não tem título internacional, o Athletico já passou ele em tudo, em títulos, estrutura, formação de atletas, etc.
Agora o Vasco eu concordo, realmente é maior que o CAP, tem mais história, tem libertadores tbm, é um time grande...

 @zek667  Se isso fosse verdade todo ano um time brasileiro devia ganhar, o que não é o caso.

Flamengo perdeu a final de propósito em 2017? 

Sua lógica é uma piada.
